import React from "react";
import {Table,Space,Tag} from 'antd'
export default class UserList extends React.Component{
    render() {

        const columns = [
            {
                title: '用户名',
                dataIndex: 'userName',
                key: 'userName',
            },
            {
                title: '邮箱',
                dataIndex: 'email',
                key: 'email',
            },
            {
                title: '手机',
                dataIndex: 'phone',
                key: 'phone',
            },
            {
                title: '个人介绍',
                key: 'jieshao',
                dataIndex: 'jieshao',
            },
            {
                title: 'Action',
                dataIndex: 'jieshao',
                key: 'action',
            }
        ];

        const data = [
            {
                key: '1',
                name: 'John Brown',
                age: 32,
                address: 'New York No. 1 Lake Park',
                tags: ['nice', 'developer'],
            },
            {
                key: '2',
                name: 'Jim Green',
                age: 42,
                address: 'London No. 1 Lake Park',
                tags: ['loser'],
            },
            {
                key: '3',
                name: 'Joe Black',
                age: 32,
                address: 'Sidney No. 1 Lake Park',
                tags: ['cool', 'teacher'],
            },
        ];

        return (
            <Table columns={columns} dataSource={data} />
        );
    }
}
